import Header from '../components/header'
import Footer from '../components/footer'
import TestimonialSection from '../components/index-sections/testimonial'
const Index = () => {
    return (
        <div>
            <Header/>
            <TestimonialSection />
            <Footer/>
        </div>
    )
}

export default Index
